import {
    AppBar,
    Button,
    Card,
    CardActionArea,
    CardActions,
    CardContent,
    CardMedia, Divider,
    Grid,
    IconButton, ListItem, ListItemButton,
    Typography
} from "@mui/material";
import Box from "@mui/material/Box";


import React, {useState} from "react";

import personalData from "../imgs/personaldata.png"
import {useLocation, useNavigate} from "react-router-dom";
import Toolbar from "@mui/material/Toolbar";
import ArrowBackIcon from "@mui/icons-material/ArrowBack";
import {logoutUser} from "../APIs/OauthAPI";
import {CssTextField} from "../Utils/CustomTextFields";
import Chip from "@mui/material/Chip";
import CalendarMonthIcon from "@mui/icons-material/CalendarMonth";
import List from "@mui/material/List";

const PartyDetails = () => {

    const [candidateList, setCandidateList] = useState(['candidato1', 'candidato2', 'candidato3', 'candidato4', 'candidato1', 'candidato2', 'candidato3', 'candidato4', 'candidato1', 'candidato2', 'candidato3', 'candidato4', 'candidato1', 'candidato2', 'candidato3', 'candidato4'])
    const location = useLocation()
    const navigate = useNavigate()
    const party = location.state.party
    const tokenData = location.state.token
    const isVisitor = location.state.isVisitor
    const votation = location.state.votation
    const user = location.state.user

    const handleCandidateDetailsOpen = (value: any) => {
        console.log(value)
        navigate('/votations/votationDetails/partyDetails/candidateDetails', {
            state: {
                token: tokenData,
                user: user,
                votation: votation,
                party: party,
                candidate: value
            }
        })
    }

    const logout = async () => {
        if (tokenData !== null) {
            const response = await logoutUser(tokenData)
            if (typeof response === 'boolean') {
                if (response) {
                    navigate('/')
                } else {
                    console.log('error')
                }
            } else {
                navigate('/error', {state: {error: response}})
            }
        }
    }

    const goBack = () => {
        navigate(-1)
    }

    const login = () => {
        window.location.assign('http://localhost:8080/login')
    }


    return (
        <>
            <Grid container direction='row' spacing={5}>
            <Box sx={{flexGrow: 1}}>
                <AppBar position="fixed" sx={{backgroundColor: '#3d4347'}}>
                    <Toolbar>
                        <IconButton
                            size="small"
                            edge="start"
                            aria-label="menu"
                            sx={{mr: 2}}
                        >
                            <ArrowBackIcon onClick={goBack} sx={{fontSize: '3rem', color: 'white'}}/>
                        </IconButton>

                        <Typography variant="h6" component="div" sx={{flexGrow: 1}}
                                    style={{
                                        justifyContent: 'center',
                                        color: '#feac0d',
                                        textAlign: 'center',
                                        fontSize: '1.8rem',
                                    }}>
                            {party}
                        </Typography>
                        <Button
                            onClick={isVisitor ? login : logout}
                            style={{
                                color: 'white',
                                backgroundColor: isVisitor ? "green" : "red",
                            }}>

                            {isVisitor ? "login" : "logout"}
                        </Button>
                    </Toolbar>
                </AppBar>
            </Box>
        </Grid>
            <Grid container display="flex" justifyContent="flex-start" alignItems="center"
                  sx={{width: '100%', position:'fixed', top:100}} spacing={3}>
                <Grid item xs={12}>
                    <Box sx={{width: '100%', height: '100%', border: '2.5px solid #feac0d',}}>
                        <CssTextField
                            sx={{input:{color:'white'}, width: '100%', height: '100%',}}
                            value={'Descrizione'}
                            maxRows={5}
                            multiline
                            InputProps={{
                                readOnly: true,
                                inputProps: {
                                    style: {
                                        color: 'white',
                                    }
                                }
                            }}/>
                    </Box>
                </Grid>
                <Grid item xs={12}>
                    {
                        (user && user.admin) ? null : user? <Grid item xs={12} display="flex" justifyContent='center' alignItems="right">
                            <Button style={{
                                borderRadius: 35,
                                backgroundColor: "#ff3823",
                                padding: "10px 20px",
                                fontSize: "18px"
                            }}
                                    variant="contained">
                                VOTA Partito
                            </Button>
                        </Grid>: null
                    }
                </Grid>
                <Grid item xs={12} display="flex" justifyContent="center" alignItems="center">
                    <List sx={{
                        width: '80%',
                        overflow: 'auto',
                        maxHeight: 580,
                    }}>
                        {candidateList.map((value, index) => {
                            return (
                                <>
                                    <Card sx={{maxWidth: 345, margin: '20px'}}>
                                        <CardActionArea onClick={() => {
                                            handleCandidateDetailsOpen(value)
                                        }}>
                                            <CardMedia
                                                component="img"
                                                height="140"
                                                image={personalData}
                                                alt={value}
                                            />
                                            <CardContent>
                                                <Typography gutterBottom variant="h5" component="div">
                                                    {value}
                                                </Typography>
                                                <Typography variant="body2" color="text.secondary">
                                                    Descrizione breve del candidato
                                                    Impegnato nel sociale e attivo nella comunità
                                                </Typography>
                                            </CardContent>
                                        </CardActionArea>
                                        {
                                            user && user.admin ? null : user? <CardActions style={{alignItems: 'center'}}>
                                                <Button size="large" style={{color: '#ff3823', width: '100%'}}>Vota Candidato</Button>
                                            </CardActions>: null
                                        }
                                    </Card>

                                </>
                            );
                        })}
                    </List>
                </Grid>
            </Grid>
        </>
    );
}

export default PartyDetails;
